import React from 'react';
import {
  Button, Drawer,
  withStyles
} from '@material-ui/core';

const MobileBar = ({ classes }) => {

  return (
    <div>
      <div style={{color: '#f50057', fontSize: 20, fontWeight: 'bold'}}>
          MovieDB App
      </div>
      <Drawer
        // className={classes.drawer}
        variant="persistent"
        anchor="left"
        open
        classes={{
          paper: classes.drawerPaper
        }}
      >

      </Drawer>
    </div>
  );
}

const styles = () => ({
  drawer: {
    width: 200,
    backgroundColor: 'red'
  }
});

export default withStyles(styles)(MobileBar);
